import React, { useEffect, useState } from 'react';
import { User } from './types/auth';
import { authService } from './lib/auth';
import AudioPlayer from './components/AudioPlayer';
import VideoPlayer from './components/VideoPlayer';
import { Header } from './components/Header';
import Login from './components/Login';
import TextToSpeech from './components/TextToSpeech';
import ErrorBoundary from './components/ErrorBoundary';
import logo from './assets/Logo Site Império.png';

const App: React.FC = () => {
  const [user, setUser] = useState<User | null>(null);
  const [loading, setLoading] = useState(true);
  const [audioEnded, setAudioEnded] = useState(false);
  const [videoEnded, setVideoEnded] = useState(false);
  const [isAudioPlaying, setIsAudioPlaying] = useState(false);
  const [isVideoPlaying, setIsVideoPlaying] = useState(false);
  const [pendingVideoId, setPendingVideoId] = useState<string | undefined>(undefined);
  const [showTextToSpeech, setShowTextToSpeech] = useState(false);
  const [isMediaTransitioning, setIsMediaTransitioning] = useState(false);

  useEffect(() => {
    checkUser();
  }, []);

  useEffect(() => {
    const handleMediaTransition = () => {
      setIsMediaTransitioning(true);
      setTimeout(() => setIsMediaTransitioning(false), 500);
    };

    window.addEventListener('audioStarting', handleMediaTransition);
    window.addEventListener('videoStarting', handleMediaTransition);

    return () => {
      window.removeEventListener('audioStarting', handleMediaTransition);
      window.removeEventListener('videoStarting', handleMediaTransition);
    };
  }, []);

  const checkUser = async () => {
    try {
      const user = await authService.getCurrentUser();
      setUser(user);
    } catch (error) {
      // Silenciosamente lida com o erro
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (audioEnded && videoEnded) {
      // Resetar os estados
      setAudioEnded(false);
      setVideoEnded(false);

      // Pequeno delay antes de iniciar
      setTimeout(() => {
        setIsAudioPlaying(true);
        setIsVideoPlaying(true);
      }, 100);
    }
  }, [audioEnded, videoEnded]);

  const handleAudioEnd = () => {
    setAudioEnded(true);
    setIsAudioPlaying(false);
  };

  const handleVideoEnd = () => {
    setVideoEnded(true);
    setIsVideoPlaying(false);
  };

  // Função para sincronizar play/pause
  const handlePlayPause = (isAudio: boolean, playing: boolean) => {
    try {
      if (isMediaTransitioning) return; // Evita mudanças de estado durante transições

      if (isAudio) {
        setIsAudioPlaying(playing);
        if (playing && isVideoPlaying) {
          window.dispatchEvent(new Event('audioStarting'));
          setIsVideoPlaying(false);
        }
      } else {
        setIsVideoPlaying(playing);
        if (playing && isAudioPlaying) {
          window.dispatchEvent(new Event('videoStarting'));
          setIsAudioPlaying(false);
        }
      }
    } catch (error) {
      console.error('Erro ao alternar play/pause:', error);
    }
  };

  const updateUser = async () => {
    try {
      const updatedUser = await authService.getCurrentUser();
      setUser(updatedUser);
    } catch (error) {
      console.error('Erro ao atualizar usuário:', error);
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-[#1e1e1e] flex items-center justify-center">
        <div className="text-center">
          <img 
            src={logo} 
            alt="Império Fitness Logo" 
            className="w-20 h-20 object-contain animate-pulse"
          />
        </div>
      </div>
    );
  }

  if (!user) {
    return <Login onLoginSuccess={checkUser} />;
  }

  return (
    <ErrorBoundary>
      <div className="min-h-screen bg-[#121212]">
        <Header 
          user={user} 
          onLogout={() => setUser(null)}
          onUserUpdate={updateUser}
        />
        <main className="container mx-auto px-4 pt-24 pb-8">
          <div className="max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="w-full">
              <AudioPlayer
                onEnded={handleAudioEnd}
                isPlaying={isAudioPlaying}
                setIsPlaying={(playing) => handlePlayPause(true, playing)}
              />
            </div>
            <div className="w-full">
              <VideoPlayer 
                videoId={pendingVideoId || ''}
                onEnded={handleVideoEnd}
                isPlaying={isVideoPlaying}
                setIsPlaying={(playing: boolean) => handlePlayPause(false, playing)}
                autoplay={false}
              />
            </div>
          </div>
        </main>

        <TextToSpeech 
          apiKey="AIzaSyBvkopJSt0VaBRbqfdtevWDuCwVRDhNZ2o"
          isOpen={showTextToSpeech}
          onClose={() => setShowTextToSpeech(false)}
        />
      </div>
    </ErrorBoundary>
  );
};

export default App;
